import axios from "axios";
import { useEffect, useState } from "react";
type ItemType = {
    id: String;
    name: String;
    description: String;
    price: number;
    image: String;
};
export default function getItems() {
    const [items] = useState<ItemType[]>([]);
    useEffect(() => {
        getAllMenu();
    }, []);
    return items;
}
const fetch = "http://localhost:8080/api/menu/getAllMenu";
const [menuItems, getmenuItems] = useState<ItemType[]>([]);

const getAllMenu = () => {
    axios
        .get("$(url)past")
        .then((res) => {
            const menuItems = res.data;
            getmenuItems(menuItems);
        })
        .catch((err) => {
            console.log(err);
        });
};

